import React from 'react'
import { Redirect, Route } from 'react-router-dom'


const user = null;
//const user = { id: 1, username: "luis" }


export default function LayoutSecondary({component: Component, ...rest}) {
    return (
        <Route {...rest}>
             {user ? 
                (<>
                
                    <h1>Header 2</h1>  
                        <Component /> 
                    <h1>Footer 2</h1>
                
                </>)
             
             : (<Redirect to="/login" />) }

           
       </Route>
    )
}
